import React, { Fragment } from 'react';
import AppMap from './Appmap';

const AppPass = (props) => {
    console.log(props.TodoPass);
    return (
        <Fragment>
          
          {
                         props.TodoPass.map((todo) => (
                             <AppMap
                             key={todo.id} 
                             todoMap={todo.todo} 
                             />
                         ))}
        
        </Fragment>
    );
};
export default AppPass;
